           website/docs/reference/sinks/honeycomb.md.erb
      */
    }
    <h2 {...{
      "id": "configuration"
    }}>{`Configuration`}</h2>
    <Tabs block={true} defaultValue="common" values={[{
      "label": "Common",
      "value": "common"
    }, {
      "label": "Advanced",
      "value": "advanced"
    }]} mdxType="Tabs">
      <TabItem value="common" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[sinks.my_sink_id]
  type = "honeycomb" # required
  inputs = ["my-source-or-transform-id"] # required
  api_key = "\${HONEYCOMB_API_KEY}" # required
  dataset = "my-honeycomb-dataset" # required
  healthcheck = true # optional, default
`}</code></pre>
      </TabItem>
      <TabItem value="advanced" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[sinks.my_sink_id]
  # General
  type = "honeycomb" # required
  inputs = ["my-source-or-transform-id"] # required
  api_key = "\${HONEYCOMB_API_KEY}" # required
  dataset = "my-honeycomb-dataset" # required
  healthcheck = true # optional, default

  # Batch
  batch.max_bytes = 5242880 # optional, default, bytes
  batch.max_events = 1000 # optional, no default, events
  batch.timeout_secs = 1 # optional, default, seconds

  # Buffer
