`}</code></pre>
      </TabItem>
    </Tabs>
    <Fields filters={true} mdxType="Fields">
      <Field common={true} defaultValue={null} enumValues={null} examples={["${HONEYCOMB_API_KEY}", "some-api-key"]} groups={[]} name={"api_key"} path={null} relevantWhen={null} required={true} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
